import React, { useState } from 'react';
import AuthService from '../../services/AuthService';
import ErrorHandler from '../../helpers/ErrorHandler';
import { Text, StyleSheet } from 'react-native';
import R from '../../assets/R';
import dictionary from '../../assets/strings/dictionary';
import CountryPicker, { CountryCode } from 'react-native-country-picker-modal';
import AppContainer from '../../components/base/app-container/AppContainer';
import AppImageView from '../../components/base/app-image/app-imageview';
import AppView from '../../components/base/app-view/AppView';
import { hp, wp } from '../../helpers/responsive-screen';
import AppTextView from '../../components/base/app-text-view/AppTextView';
import AppTouchable from '../../components/base/app-touchable/AppTouchable';
import AppTextInput from '../../components/base/app-text-input/AppTextInput';
import TermsAndConditionsModal from '../../modals/t&c-modal/TermsAndConditionsModal';
import OTPModal from '../../modals/otp-modal/OTPModal';
import ToastMaster from '../../helpers/ToastMaster';
import config from '../../config/config';
import LanguageSetModal from '../../modals/LanguageSetModal';
import useLang from '../../hooks/useLang';

function SigninScreen(props) {
  const [mobile, setMobile] = useState('');
  const [preMobile, setPreMobile] = useState('994');
  const [countryCode, setCountryCode] = useState<CountryCode>('AZ');
  const [modalVisible, setModalVisible] = useState(false);
  const [tcModalVisible, setTCModalVisible] = useState(false);
  const language = useLang();
  const [langModal, setLangModal] = useState(Boolean(!config.isLanguageSet()));

  const login = () => {
    if (mobile.length > 11 || mobile.length < 5) {
      return ToastMaster.makeText(dictionary.phone_not_valid);
    }
    const phoneNumber = (preMobile + mobile).replaceAll(' ', '').replaceAll('+', '');
    console.log(phoneNumber);
    AuthService.signIn(phoneNumber)
      .then((res) => {
        console.log('res');
        setModalVisible(true);
      })
      .catch((err) => {
        console.log('err');
        ErrorHandler.handleError(err);
      });
  };

  return (
    <AppContainer style={{ alignItems: 'flex-end', justifyContent: 'flex-end' }}>
      <AppImageView
        style={{ width: wp(100), height: wp(110), position: 'absolute', top: 0 }}
        src={
          'data:image/png;base64,'
        }
      />
      <AppView
        style={{
          backgroundColor: '#FFFFFF',
          width: '100%',
          borderTopRightRadius: hp(3),
          borderTopLeftRadius: hp(3),
          alignItems: 'center',
        }}
      >
        <AppView>
          <AppTextView
            style={{
              fontFamily: R.fonts.fontFamily,
              textAlign: 'center',
              marginTop: wp(3.3),
            }}
            textColor="#38488A"
            fontSize={wp(4)}
            text={dictionary.welcome_to_unimed}
          />
        </AppView>
        <AppTextView
          style={{
            fontFamily: R.fonts.fontFamily_Bold,
            alignSelf: 'flex-end',
            marginTop: hp(5.8),
            marginRight: wp(12),
          }}
          textColor="#38488A"
          fontSize={wp(4.6)}
          text={dictionary.mobile_number}
        />

        <AppTextView
          style={{
            textAlign: 'center',
            alignSelf: 'flex-end',
            marginRight: wp(12),
            marginTop: hp(3),
          }}
          textColor="#9e9e9e"
          fontSize={wp(3.3)}
          text={dictionary.enter_mobile_for_otp}
        />
        <AppView
          style={{
            flexDirection: 'row-reverse',
            justifyContent: 'space-between',
            height: hp(8),
            alignItems: 'center',
            marginTop: hp(1.5),
            width: wp(76),
          }}
        >
          <AppTextInput
            maxLength={11}
            keyboardType="number-pad"
            value={mobile}
            onChange={(v) => {
              if (v.startsWith('0')) {
                return;
              }
              setMobile(v);
            }}
            placeHolder={'910000000'}
            textStyle={{
              fontSize: wp(3.8),
              textAlign: 'left',
              fontFamily: R.fonts.fontFamily_faNum,
              color: '#9e9e9e',
            }}
            style={{
              width: '69%',
              height: hp(6.5),
              borderColor: '#50BCBD',
              borderWidth: 1,
              borderRadius: hp(1.2),
              justifyContent: 'center',
              paddingHorizontal: 10,
            }}
          />
          <CountryPicker
            countryCode={countryCode}
            onSelect={(v) => {
              setCountryCode(v.cca2);
              setPreMobile(v.callingCode as any);
            }}
            withCallingCodeButton
            modalProps={{ animationType: 'slide' }}
            containerButtonStyle={Styles.CountryPickerStyle}
            withFlag={false}
            withFlagButton={false}
            theme={{
              fontFamily: R.fonts.fontFamily_faNum,
              onBackgroundTextColor: '#4f4f4f',
              fontSize: wp(3.8),
            }}
          />
        </AppView>
        <AppTouchable onClick={login} style={Styles.Button}>
          <AppTextView text={dictionary.receive_code} fontSize={wp(3.8)} style={{ color: '#FFFFFF', fontFamily: R.fonts.fontFamily_Bold }} />
        </AppTouchable>
        <Text
          style={{
            fontFamily: R.fonts.fontFamily,
            textAlign: 'center',
            color: '#828282',
            fontSize: wp(2.5),
            margin: hp(2),
          }}
        >
          {dictionary.by_registering[language]}
          <Text
            style={{ fontFamily: R.fonts.fontFamily_Bold, color: '#50BCBD' }}
            onPress={() => {
              setTCModalVisible(true);
            }}
          >
            {dictionary.signin_conditions[language]}
          </Text>
          <Text>{dictionary.that_accept[language]}</Text>
        </Text>
      </AppView>

      <LanguageSetModal title={dictionary.select_language} modalVisible={langModal} closeModal={() => setLangModal(false)} />

      {modalVisible && (
        <OTPModal
          visible={modalVisible}
          onResend={login}
          onClose={() => {
            setModalVisible(false);
          }}
          mobile={mobile}
        />
      )}
      {tcModalVisible && <TermsAndConditionsModal closeModal={() => setTCModalVisible(false)} tcModalVisible={tcModalVisible} />}
    </AppContainer>
  );
}
const Styles = StyleSheet.create({
  Button: {
    width: wp(76),
    height: hp(6.5),
    backgroundColor: '#50BCBD',
    marginTop: hp(1.2),
    borderRadius: hp(1.2),
    justifyContent: 'center',
    alignItems: 'center',
    alignSelf: 'center',
  },
  langButton: {
    height: hp(6),
    width: '25%',
    position: 'absolute',
    top: hp(4),
    left: 0,
    zIndex: 100,
    alignItems: 'center',
    flexDirection: 'row',
    justifyContent: 'space-evenly',
    backgroundColor: '#50BCBD',
    borderTopRightRadius: hp(1.2),
    borderBottomRightRadius: hp(1.2),
    paddingHorizontal: hp(1),
  },
  CountryPickerStyle: {
    borderColor: '#50BCBD',
    borderWidth: 1,
    borderRadius: hp(1.2),
    height: hp(6.5),
    justifyContent: 'center',
    alignItems: 'center',
    width: wp(22),
  },
  InputMobileViewStyle: {
    width: wp(65),
    height: hp(7),
    borderColor: '#50BCBD',
    borderWidth: 1,
    borderRadius: 10,
    justifyContent: 'center',
  },
  InputMobileTextStyle: {
    fontSize: wp(4.6),
    textAlign: 'left',
    paddingHorizontal: 20,
    fontFamily: R.fonts.fontFamily_faNum,
  },
});

export default React.memo(SigninScreen);
